# Cách này tối ưu hơn cách trên nè
class Solution(object):
    def firstUniqChar(self, s):
        """
        :type s: str
        :rtype: int
        """
        alphabet = 'abcdefghijklmnopqrstuvwxyz'
        firstUniqCharIdx = 10**5 #10**5 is the max length of s

        for letter in alphabet:
            x = s.find(letter) #Returns first index of character in a string. If not found returns -1
            
            if x == -1: #If letter not in string, do nothing
                continue
            
            if x < firstUniqCharIdx and x == s.rfind(letter):
                firstUniqCharIdx = x
    
        if firstUniqCharIdx == 10**5:
            return -1
        else:
            return firstUniqCharIdx
            
        
    
str = ""
print(Solution().firstUniqChar(str))